import React from "react";
import "./TeamPage.css";

const teamMembers = [
  {
    id: 1,
    name: "John Doe",
    college: "XYZ University",
    description: "A passionate coder with a knack for solving problems and innovating.",
    image: "member1.jpg",
  },
  {
    id: 2,
    name: "Jane Smith",
    college: "ABC Institute",
    description: "Creative designer with a flair for turning ideas into beautiful designs.",
    image: "member2.jpg",
  },
  {
    id: 3,
    name: "Chris Johnson",
    college: "PQR College",
    description: "Full-stack developer with a love for both front-end and back-end development.",
    image: "member3.jpg",
  },
  {
    id: 4,
    name: "Emily Davis",
    college: "DEF Academy",
    description: "Data scientist who thrives on finding patterns in chaos.",
    image: "member4.jpg",
  },
  {
    id: 5,
    name: "Michael Brown",
    college: "GHI University",
    description: "Cloud computing expert ensuring seamless online experiences.",
    image: "member5.jpg",
  },
  {
    id: 6,
    name: "Sarah Wilson",
    college: "JKL Institute",
    description: "AI enthusiast pushing boundaries with innovative machine learning models.",
    image: "member6.jpg",
  },
  {
    id: 7,
    name: "David Miller",
    college: "MNO College",
    description: "Cybersecurity expert dedicated to keeping systems secure.",
    image: "member7.jpg",
  },
];

const TeamPage = () => {
  return (
    <div className="team-page">
      <header>
        <h1>Our Amazing Team</h1>
      </header>
      <div className="card-container">
        {teamMembers.map((member) => (
          <div key={member.id} className="card">
            <img src={member.image} alt={member.name} />
            <h2>{member.name}</h2>
            <p className="college">{member.college}</p>
            <p className="description">{member.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TeamPage;
